import Overview from "./Overview";
import Repositories from "./Repositories";
import Projects from "./Projects";
import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { NavLink} from 'react-router-dom';
import RepoResPage from "../RepoResPage";


const Navbar = () => {

  

    return (

<Router>

    <nav className=" border-b-2 border-gray-200">
    
        <div className="flex justify-center mr-72"  >
            <NavLink to="/Overv" className={({ isActive, isPending }) =>
                     isPending ? "" : isActive ? "border-b-2 border-orange-400 font-semibold" : "cursor-pointer hover:bg-gray-100" }>
                            <Overview />
            </NavLink>
            <NavLink to="/RepoResPage" className={({ isActive, isPending }) =>
                     isPending ? "" : isActive ? "border-b-2 border-orange-400 font-semibold" : "cursor-pointer hover:bg-gray-100" }>
                            <Repositories />
            </NavLink>
            <NavLink to="/Proj" className={({ isActive, isPending }) =>
                     isPending ? "" : isActive ? "border-b-2 border-orange-400 font-semibold" : "cursor-pointer hover:bg-gray-100" }>
                            <Projects />
            </NavLink>
        
        </div>

    </nav>

    <Routes>
          
          <Route path="/RepoResPage" Component={RepoResPage} />
          
    </Routes>
        
</Router>
    )
}
export default Navbar;



